insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000036208, 'LANGESP', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10001032, 'ZPK se utiliza de distintas maneras. La idea principal es cifrar PIN para la transferencia entre partes que se comunican. Así ZPK está siempre asociada con los sistemas externos. ZPK puede ser local si se utiliza como clave para cifrar PIN recién generado (sólo para Safenet hardware HSM).')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000036209, 'LANGESP', NULL, 'COM_DICTIONARY', 'NAME', 10001032, 'Zona PIN clave')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000036210, 'LANGESP', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10001033, 'PVK se utiliza para generar y verificar datos de PIN de verificación (PVV, PIN-offset) y así verificar la autenticidad de un PIN. PVK uso puede variar de acuerdo con diferentes métodos de verificación de PIN. Para los métodos de visado, es posible tener hasta 7 PVK. Para IBM3624 PVK método se utiliza con mesa decimalización.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000036211, 'LANGESP', NULL, 'COM_DICTIONARY', 'NAME', 10001033, 'PIN Comprobación de las claves')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000036212, 'LANGESP', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10001040, 'CVK se utiliza para genearating y validación de los datos de la tarjeta de verificación, es decir, CVV.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000036213, 'LANGESP', NULL, 'COM_DICTIONARY', 'NAME', 10001040, 'Tarjeta de Comprobación de las claves')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000036214, 'LANGESP', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10001041, 'CVK2 se utiliza para genearating y validación de la tarjeta y la información de verificación del tarjetahabiente, es decir, CVV2.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000036215, 'LANGESP', NULL, 'COM_DICTIONARY', 'NAME', 10001041, 'Tarjeta de clave de Verificación 2')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000036216, 'LANGESP', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10001043, 'TMK es la clave de terminal que se utiliza para transferir otras teclas del terminal (TPK, TAK) entre el terminal y el host en el caso de procedimiento de cambio de clave. TMK se almacena a ambos lados de interacción. TMK para TPK se utiliza si el terminal admite claves separadas maestras para encriptación de los diferentes tipos de clave. En este caso TMK para TPK se utiliza en lugar de TMK regular para transferir claves TPK.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000036217, 'LANGESP', NULL, 'COM_DICTIONARY', 'NAME', 10001043, 'Terminal PIN Master Key')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000036218, 'LANGESP', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10001044, 'TMK es la clave de terminal que se utiliza para transferir otras teclas del terminal (TPK, TAK) entre el terminal y el host en el caso de procedimiento de cambio de clave. TMK se almacena a ambos lados de interacción. TMK para TAK se utiliza si el terminal admite claves separadas maestras para encriptación de los diferentes tipos de clave. En este caso TMK para TAK se utiliza en lugar de TMK regular para transferir claves de TAK.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000036219, 'LANGESP', NULL, 'COM_DICTIONARY', 'NAME', 10001044, 'Terminal de Mac Master Key')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000036220, 'LANGESP', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10001045, 'TPK se utiliza para PIN Enscript en el Bloque PIN durante la transferencia es entre el terminal y el sistema host. TPK debe ser conocida en ambos lados de interacción.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000036221, 'LANGESP', NULL, 'COM_DICTIONARY', 'NAME', 10001045, 'PIN clave de sesión de Terminal')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000036222, 'LANGESP', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10001046, 'TAK se utiliza para generar el código de autenticación de mensajes (MAC) para el mensaje que se transmite desde el terminal al host o viceversa. TAK también se utiliza para verificar MAC. TAK debe ser conocida en ambos lados de interacción.')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000036223, 'LANGESP', NULL, 'COM_DICTIONARY', 'NAME', 10001046, 'Terminal MAC clave de sesión')
/
insert into com_i18n (id, lang, entity_type, table_name, column_name, object_id, text) values (100000036224, 'LANGESP', NULL, 'COM_DICTIONARY', 'DESCRIPTION', 10001047, 'IMKac se utiliza para verificar los datos de transacción EMV mientras se procesa. Se utiliza para verificar APQC (criptograma que se ha generado en el lado del terminal) y para generar ARPC (criptograma host). La clave se genera en la tarjeta de la generación de proceso.')
